export default () => {
  return (
    <NavigationContainer>
    <MainStack.Navigator initialRouteName="LoginScreen">
    <MainStack.Screen name="RegistrationScreen" component={RegistrationScreen} />
    <MainStack.Screen name="LoginScreen" component={LoginScreen} />
  </MainStack.Navigator>
    </NavigationContainer>
  );
};

